import ReactDOM from  'react-dom';

function MenuCard(props){
  return(
    
  <div class='card-container'>
   <button>
    <div class='card'>
    
     <div class='card-icon'>
      {props.children }
     </div>
     
    </div>
    </button>
     {props.name}
  </div>

)}



export default MenuCard;
